/*Table structure for table `agro_farmer` */

DROP TABLE IF EXISTS `agro_farmer`;


CREATE TABLE `agro_farmer` (
  `id` bigint(20) NOT NULL AUTO_INCREMENT,
  `apelido` varchar(255) DEFAULT NULL,
